class Joints():
    def __init__(self):
        rospy.Subscriber("/mur216/joint_states", JointState, self.cb_joint_states)
        self.rate = rospy.Rate(10)
        self.q = [0,0,0,0,0,0]

    def cb_joint_states(self, msg=JointState()):
        self.q0=msg.position[msg.name.index("UR16/shoulder_pan_joint")]
        self.q1=msg.position[msg.name.index("UR16/shoulder_lift_joint")]
        self.q2=msg.position[msg.name.index("UR16/elbow_joint")]
        self.q3=msg.position[msg.name.index("UR16/wrist_1_joint")]
        self.q4=msg.position[msg.name.index("UR16/wrist_2_joint")]
        self.q5=msg.position[msg.name.index("UR16/wrist_3_joint")]
        # idxs=range(idx0,idx_eef)
        self.q = [self.q0, self.q1, self.q2, self.q3, self.q4, self.q5]

